// About.js
import React from 'react';
import './About.css';

function About() {
    return (
        <div className="about">
            <h2>ABOUT US</h2>
            <p>I am Volodymyr Husliev, a Unity Developer with over 3 years of experience in game and app development. My passion for creating interactive and immersive experiences has driven me to specialize in Unity and build engaging games and mobile applications.

                With a deep understanding of both the technical and creative aspects of development, I focus on delivering high-quality solutions that meet the needs of users while pushing the boundaries of what's possible. I work with both 2D and 3D environments, integrating complex gameplay mechanics, optimizing performance, and ensuring seamless user experiences.

                Constantly exploring new techniques and technologies, I aim to stay on the cutting edge of development, committed to continuously improving my skills and delivering better products.</p>
        </div>

    );
}

export default About;
